import React from 'react';

import {Route} from 'react-router-dom';
import CollectionOverview from '../../components/collection-overview/collection-overview.component';
import CollectionPage from '../../pages/collection-page/collection-page.component';

import './shopAll-collection.style.css';

const ShopAllPage = ({match}) => {
    console.log(match);
    return( <div className='shop-all-page-container'>
        <div className='shop-all-product-container'>
            <Route exact parh={`${match.path}`} component={CollectionOverview} />
            <Route path={`${match.path}/:collectionId`} component={CollectionPage} />
        </div>
    </div>   )

};



export default ShopAllPage;
